  '4 Softkeys unter dem Bildschirm' => '4 softkeys below display',
  '<b>12 Leitungstasten</b><br /> Diese Tasten lassen sich mit Rufnummern programmieren.<br /> Im Men&uuml;punkt &quot;Tastenbelegung&quot; k&ouml;nnen Sie Ihre Einstellung ansehen und ver&auml;ndern.' => '<b>12 Line keys</b><br /> These keys can be programmed with phone numbers.<br /> You can access and modify your settings in the &quot;Softkeys&quot; menu.',
  '<b>Abbrechen</b><br /> Gespr&auml;ch beenden, Gespr&auml;ch abweisen' => '<b>Cancel</b><br /> Hangup call, deflect call',
  '<b>Achtung:</b> Vergessen Sie dieses Pa&szlig;wort nicht!' => '<b>Attention:</b> Do not forget this password!',
  '<b>Anrufbeantworter</b> abfragen<br /> Hat der Anrufbeantworter ein Gespr&auml;ch f&uuml;r Sie aufgezeichnet, wird dies durch Blinken der Message-LED signalisiert. Die Anzahl alter und neuer Nachrichten wird zus&auml;tzlich auch auf dem Display angezeigt.' => 'Check <b>Voicemail</b><br /> Once there are new messages on your mailbox the message LED will start blinking. Your display will show the numbers of new and old messages.',
  '<b>Best&auml;tigen</b><br /> W&auml;hlen, Gespr&auml;ch annehmen' => '<b>Confirm</b><br /> Dial, answer call',
  '<b>Halten</b> (R&uuml;ckfrage)<br /> Wenn Sie diese Taste w&auml;hrend eines Gespr&auml;chs dr&uuml;cken, wird Ihr Gespr&auml;chspartner auf Halten gesetzt. Danach k&ouml;nnen Sie eine weitere Verbindung zu einem anderen Teilnehmer herstellen. Mit den leuchtenden Leitungstasten k&ouml;nnen Sie zwischen beiden Leitungen hin- und herschalten (Makeln).' => '<b>Hold</b> (R, consultation hold)<br /> If you press this key during a call the other party will be set on hold. Then you can initiate a second connection to another party. You can switch back and forth between the lines with the line keys (consultation hold).',
  '<b>Lauth&ouml;ren</b> ein/aus' => '<b>Speaker</b> on/off',
  '<b>Lautst&auml;rke</b> des H&ouml;rers oder Lautsprechers -/+' => '<b>Volume</b> of handset or speaker -/+',
  '<b>Nicht st&ouml;ren</b> ein/aus<br /> Wenn dieser Modus aktiviert ist, werden keine Anrufe zu Ihrem Telefon durchgestellt. Dabei wird auf dem Display links unten das Symbol und &quot;Inaktiv&quot; angezeigt. Auf Ihre ggf. eingestellte Rufweiterleitung wirkt dieser Modus, als w&auml;ren Sie gar nicht eingeloggt, also offline.' => '<b>Do Not Disturb (DND)</b> mode on/off<br /> When this mode is activated no calls will be connected to your phone. The phone will display the DND symbol and &quot;Inactive&quot; in the lower left corner. Your call forwarding (if configured) will act as if you were not logged in, i.e. offline.',
  '<b>Stummschaltung</b> des Mikrofons ein/aus' => '<b>Mute</b> or unmute the microphone',
  '<b>Telefonbuch</b> (Firma / pers&ouml;nlich)<br /> z.B. 63437 f&uuml;r MEIER dr&uuml;cken (&auml;hnlich &quot;T9&quot;).' => '<b>Phonebook</b> (Company / private)<br /> enter 76484 for SMITH (similar to &quot;T9&quot;).',
  '<b>Vermitteln</b><br /> Es gibt zwei Wege, wie Sie Ihren Gespr&auml;chspartner mit einer anderen Nummer verbinden k&ouml;nnen:<br /> <i>Direktes Verbinden</i>: Wenn Sie w&auml;hrend eines Gespr&auml;chs die Transfer-Taste dr&uuml;cken, wird Ihr Gespr&auml;chsparter auf Halten gesetzt. Geben Sie danach die Nummer an, mit der Sie den Anrufer verbinden m&ouml;chten. Durch Dr&uuml;cken der OK-Taste wird der Teilnehmer dann mit der gew&auml;hlten Nummer verbunden.<br /> <i>Verbinden mit R&uuml;ckfrage</i>: Dr&uuml;cken Sie hierzu w&auml;hrend eines Gespr&auml;chs die Hold-Taste um Ihren Gespr&auml;chspartner zu halten und w&auml;hlen dann die Nummer, mit der Sie ihn verbinden m&ouml;chten. Sie k&ouml;nnen jetzt mit dem zweiten Teilnehmer sprechen. Durch Dr&uuml;cken der Transfer-Taste oder durch Auflegen werden die beiden Teilnehmer verbunden.' => '<b>Transfer</b><br /> There are two different ways to connect the other party on a call to another phone number:<br /> <i>Blind Transfer</i>: If you press the Transfer key during a call the other party will be set on hold. Now enter the number to which you want to transfer the other party to. By pressing the OK key the other party will be transferred.<br /> <i>Attended Transfer</i>: Press the Hold key during a call to set the other party on hold, then enter the number to which you want to connect them to. You can now talk to the target party. By pressing the Transfer key or by hanging up both parties will be connected.',
